    return () => {
        let totalCount = 0

        if (displayZoneLevel.value === 1) {
            totalCount = jjamTong.zone_level_1?.length || 0
        } else if (displayZoneLevel.value === 2) {
            totalCount = jjamTong.zone_level_2?.length || 0
